import React, { Component } from 'react';
import { Card } from 'reactstrap';
import khuNha_icon from '../../../images/admin/khuNha_icon.png';
import '../../../style/khuNha.css'
import '../../../style/style1.css'

export default class KhuNha extends Component {
    constructor(props) {
        super(props);

        this.state = {
            over: "false"
        }
    }

    overThis = function() {
        this.setState({
            over: !this.state.over
        });
    }

    render() {
        return (
                <div className="col-md-3">
                    <div className="khuNha_item view .view-first" >
                        <center><img className="khuNhaImage" src={khuNha_icon} alt="KHUNHA" /></center>
                        <center className="tenKhuNha"><b>{this.props.tenKhuNha}</b></center>
                    </div>
                </div>
        );
    }
}
